(162, '_site_transient_wp_plugin_dependencies_plugin_data', 'a:1:{s:15:\"ultimate-member\";a:35:{s:4:\"name\";s:116:\"Ultimate Member – User Profile, Registration, Login, Member Directory, Content Restriction &amp; Membership Plugin\";s:4:\"slug\";s:15:\"ultimate-member\";s:7:\"version\";s:6:\"2.10.5\";s:6:\"author\";s:76:\"<a href=\"https://profiles.wordpress.org/ultimatemember/\">Ultimate Member</a>\";s:14:\"author_profile\";s:46:\"https://profiles.wordpress.org/ultimatemember/\";s:12:\"contributors\";a:3:{s:14:\"ultimatemember\";a:3:{s:7:\"profile\";s:46:\"https://profiles.wordpress.org/ultimatemember/\";s:6:\"avatar\";s:120:\"https://secure.gravatar.com/avatar/b27656f03037b4d5f03d0a72a729fb463d179f725e068962c906c38f5a495f7c?s=96&d=monsterid&r=g\";s:12:\"display_name\";s:15:\"Ultimate Member\";}s:15:\"champsupertramp\";a:3:{s:7:\"profile\";s:47:\"https://profiles.wordpress.org/champsupertramp/\";s:6:\"avatar\";s:120:\"https://secure.gravatar.com/avatar/84238f519476e1a78b18e7ff5b0e5a18b5bcdaa9c6b4c4e91324db7ed29ece5f?s=96&d=monsterid&r=g\";s:12:\"display_name\";s:11:\"Champ Camba\";}s:11:\"nsinelnikov\";a:3:{s:7:\"profile\";s:43:\"https://profiles.wordpress.org/nsinelnikov/\";s:6:\"avatar\";s:120:\"https://secure.gravatar.com/avatar/a585086eb557690eb6ad9354b15737c57687462aed7870b9e40315366825b931?s=96&d=monsterid&r=g\";s:12:\"display_name\";s:17:\"Mykyta Synelnikov\";}}s:8:\"requires\";s:3:\"6.2\";s:6:\"tested\";s:5:\"6.8.2\";s:12:\"requires_php\";s:3:\"7.0\";s:16:\"requires_plugins\";a:0:{}s:6:\"rating\";i:88;s:7:\"ratings\";a:5:{i:5;i:1140;i:4;i:70;i:3;i:38;i:2;i:46;i:1;i:148;}s:11:\"num_ratings\";i:1442;s:11:\"support_url\";s:53:\"https://wordpress.org/support/plugin/ultimate-member/\";s:15:\"support_threads\";i:112;s:24:\"support_threads_resolved\";i:94;s:15:\"active_installs\";i:200000;s:12:\"last_updated\";s:21:\"2025-06-25 6:49pm GMT\";s:5:\"added\";s:10:\"2015-01-21\";s:8:\"homepage\";s:26:\"http://ultimatemember.com/\";s:8:\"sections\";a:6:{s:11:\"description\";s:10121:\"<h4>User Profile &amp; Membership Plugin for WordPress</h4>\n<p>The ultimate user profile &amp; membership plugin for WordPress. The plugin makes it a breeze for users to sign-up and become members of your website. The plugin allows you to add beautiful user profiles to your site and is designed for creating advanced online communities and membership sites. Lightweight and highly extendible, Ultimate Member will enable you to create almost any type of site where users can join and become members with absolute ease.</p>\n<h4>Features of the plugin include:</h4>\n<ul>\n<li>Front-end user profiles</li>\n<li>Front-end user registration</li>\n<li>Front-end user login</li>\n<li>Custom form fields</li>\n<li>Conditional logic for form fields</li>\n<li>Drag and drop form builder</li>\n<li>User account page</li>\n<li>Custom user roles</li>\n<li>Member directories</li>\n<li>User emails</li>\n<li>Content restriction</li>\n<li>Conditional nav menus</li>\n<li>Show author posts &amp; comments on user profiles</li>\n<li>Developer friendly with dozens of actions and filters</li>\n</ul>\n<p>Read about all of the plugin&#8217;s features at <a href=\"https://ultimatemember.com\" rel=\"nofollow ugc\">Ultimate Member</a></p>\n<h4>Paid Extensions</h4>\n<p>Ultimate Member has a range of extensions that allow you to extend the power of the plugin. You can purchase all of these extensions at a significant discount with one of our <a href=\"https://ultimatemember.com/pricing/\" rel=\"nofollow ugc\">paid plans</a> or you can purchase extensions individually.</p>\n<ul>\n<li><a href=\"https://ultimatemember.com/extensions/zapier/\" rel=\"nofollow ugc\">Zapier</a> &#8211; Allow to integrate the Zapier popular apps with Ultimate Member</li>\n<li><a href=\"https://ultimatemember.com/extensions/stripe/\" rel=\"nofollow ugc\">Stripe</a> &#8211; Sell paid memberships to access your website via Stripe subscriptions</li>\n<li><a href=\"https://ultimatemember.com/extensions/user-notes/\" rel=\"nofollow ugc\">User Notes</a> &#8211; Allow users to create public and private notes from their profile</li>\n<li><a href=\"https://ultimatemember.com/extensions/profile-tabs/\" rel=\"nofollow ugc\">Profile Tabs</a> &#8211; Allow to add the custom tabs to profiles</li>\n<li><a href=\"https://ultimatemember.com/extensions/user-locations/\" rel=\"nofollow ugc\">User Locations</a> &#8211; Allow to display users on a map on the member directory page and allow users to add their location via their profile</li>\n<li><a href=\"https://ultimatemember.com/extensions/unsplash/\" rel=\"nofollow ugc\">Unsplash</a> &#8211; Allow users to select a profile cover photo from <a href=\"https://unsplash.com/\" rel=\"nofollow ugc\">Unsplash</a> from their profile</li>\n<li><a href=\"https://ultimatemember.com/extensions/user-bookmarks/\" rel=\"nofollow ugc\">User Bookmarks</a> &#8211; Allow users to bookmark content from your website</li>\n<li><a href=\"https://ultimatemember.com/extensions/user-photos/\" rel=\"nofollow ugc\">User Photos</a> &#8211; Allow users to upload photos to their profile</li>\n<li><a href=\"https://ultimatemember.com/extensions/groups/\" rel=\"nofollow ugc\">Groups</a> &#8211; Allow users to create and join groups around shared topics, interests etc.</li>\n<li><a href=\"https://ultimatemember.com/extensions/private-content/\" rel=\"nofollow ugc\">Private Content</a> &#8211; Display private content to logged in users that only they can access</li>\n<li><a href=\"https://ultimatemember.com/extensions/user-tags/\" rel=\"nofollow ugc\">User Tags</a> &#8211; Lets you add a user tag system to your website</li>\n<li><a href=\"https://ultimatemember.com/extensions/social-activity/\" rel=\"nofollow ugc\">Social Activity</a> &#8211; Let users create public wall posts &amp; see the activity of other users</li>\n<li><a href=\"https://ultimatemember.com/extensions/woocommerce/\" rel=\"nofollow ugc\">WooCommerce</a> &#8211; Allow you to integrate WooCommerce with Ultimate Member</li>\n<li><a href=\"https://ultimatemember.com/extensions/private-messages/\" rel=\"nofollow ugc\">Private Messages</a> &#8211; Add a private messaging system to your site &amp; allow users to message each other</li>\n<li><a href=\"https://ultimatemember.com/extensions/followers/\" rel=\"nofollow ugc\">Followers</a> &#8211; Allow users to follow each other on your site and protect their profile information</li>\n<li><a href=\"https://ultimatemember.com/extensions/real-time-notifications/\" rel=\"nofollow ugc\">Real-time Notifications</a> &#8211; Add a notifications system to your site so users can receive real-time notifications</li>\n<li><a href=\"https://ultimatemember.com/extensions/social-login/\" rel=\"nofollow ugc\">Social Login</a> &#8211; Let users register &amp; login to your site via Facebook, Twitter, G+, LinkedIn, Instagram and Vkontakte (VK.com)</li>\n<li><a href=\"https://ultimatemember.com/extensions/bbpress/\" rel=\"nofollow ugc\">bbPress</a> &#8211; With the bbPress extension you can beautifully integrate Ultimate Member with bbPress</li>\n<li><a href=\"https://ultimatemember.com/extensions/mailchimp/\" rel=\"nofollow ugc\">MailChimp</a> &#8211; Allow users to subscribe to your MailChimp lists when they signup on your site and sync user meta to MailChimp</li>\n<li><a href=\"https://ultimatemember.com/extensions/user-reviews/\" rel=\"nofollow ugc\">User Reviews</a> &#8211; Allow users to rate &amp; review each other using a 5 star rate/review system</li>\n<li><a href=\"https://ultimatemember.com/extensions/verified-users/\" rel=\"nofollow ugc\">Verified Users</a> &#8211; Add a user verification system to your site so user accounts can be verified</li>\n<li><a href=\"https://ultimatemember.com/extensions/mycred/\" rel=\"nofollow ugc\">myCRED</a> &#8211; With the myCRED extension you can integrate Ultimate Member with the popular myCRED points management plugin</li>\n<li><a href=\"https://ultimatemember.com/extensions/notices/\" rel=\"nofollow ugc\">Notices</a> &#8211; Alert users to important information using conditional notices</li>\n<li><a href=\"https://ultimatemember.com/extensions/profile-completeness/\" rel=\"nofollow ugc\">Profile Completeness</a> &#8211; Encourage or force users to complete their profiles with the profile completeness extension</li>\n<li><a href=\"https://ultimatemember.com/extensions/friends/\" rel=\"nofollow ugc\">Friends</a> &#8211; Allows users to become friends by sending &amp; accepting/rejecting friend requests</li>\n</ul>\n<h4>Free Extensions</h4>\n<ul>\n<li><a href=\"https://ultimatemember.com/extensions/jobboardwp/\" rel=\"nofollow ugc\">JobsBoardWP</a> &#8211; This free extension integrates Ultimate Member with the job board plugin <a href=\"https://wordpress.org/plugins/jobboardwp\" rel=\"ugc\">JobBoardWP</a>.</li>\n<li><a href=\"https://ultimatemember.com/extensions/forumwp/\" rel=\"nofollow ugc\">ForumWP</a> &#8211; This free extension integrates Ultimate Member with the forum plugin <a href=\"https://forumwpplugin.com\" rel=\"nofollow ugc\">ForumWP</a>.</li>\n<li><a href=\"https://ultimatemember.com/extensions/terms-conditions/\" rel=\"nofollow ugc\">Terms &amp; Conditions</a> &#8211; Add a terms and condition checkbox to your registration forms &amp; require users to agree to your T&amp;Cs before registering on your site.</li>\n<li><a href=\"https://ultimatemember.com/extensions/google-recaptcha/\" rel=\"nofollow ugc\">Google reCAPTCHA</a> &#8211; Stop bots on your registration &amp; login forms with Google reCAPTCHA</li>\n<li><a href=\"https://ultimatemember.com/extensions/online-users/\" rel=\"nofollow ugc\">Online Users</a> &#8211; Display what users are online with this extension</li>\n</ul>\n<h4>Theme</h4>\n<p>Our official <a href=\"https://ultimatemember.com/theme/\" rel=\"nofollow ugc\">theme</a> is purpose built for websites that have logged in and out users. The <a href=\"https://ultimatemember.com/theme/\" rel=\"nofollow ugc\">theme</a> has deep integration with Ultimate Member plugin and the extensions, different header designs for logged-in/out users and works alongside the Beaver Builder and Elementor page builders.</p>\n<h4>Our other plugins</h4>\n<p>In addition to Ultimate Member, we also have two other plugins: <a href=\"https://forumwpplugin.com/\" rel=\"nofollow ugc\">ForumWP</a> and <a href=\"https://wordpress.org/plugins/jobboardwp\" rel=\"ugc\">JobBoardWP</a>.</p>\n<h4>ForumWP</h4>\n<p><a href=\"https://forumwpplugin.com/\" rel=\"nofollow ugc\">ForumWP</a> is a forum plugin which adds an online forum to your website, allowing users to create topics and write replies. Forums are a great way to build and grow an online community.</p>\n<h4>JobBoardWP</h4>\n<p><a href=\"https://wordpress.org/plugins/jobboardwp\" rel=\"ugc\">JobBoardWP</a> is a job board plugin which adds a modern job board to your website. Display job listings and allow employers to submit and manage jobs all from the front-end.</p>\n<h4>Development * Translations</h4>\n<p>If you&#8217;re a developer and would like to contribute to the source code of the plugin you can do so via our <a href=\"https://github.com/ultimatemember/ultimatemember\" rel=\"nofollow ugc\">GitHub Repository</a>.</p>\n<p>Want to add a new language to Ultimate Member? Great! You can contribute via <a href=\"https://translate.wordpress.org/projects/wp-plugins/ultimate-member\" rel=\"nofollow ugc\">translate.wordpress.org</a>.</p>\n<p>If you are a developer and you need to know the list of UM Hooks, make this via our <a href=\"https://docs.ultimatemember.com/article/1324-hooks-list\" rel=\"nofollow ugc\">Hooks Documentation</a> or <a href=\"https://ultimatemember.github.io/ultimatemember/hooks/\" rel=\"nofollow ugc\">Hooks Documentation v2</a>.</p>\n<p>If you are a developer and you need to know the structure of our code, make this via our <a href=\"https://ultimatemember.github.io/ultimatemember/phpdoc/\" rel=\"nofollow ugc\">Documentation API</a>.</p>\n<h4>Documentation &amp; Support</h4>\n<p>Got a problem or need help with Ultimate Member? Head over to our <a href=\"http://docs.ultimatemember.com/\" rel=\"nofollow ugc\">documentation</a> and perform a search of the knowledge base. If you can’t find a solution to your issue then you can create a topic on the <a href=\"https://wordpress.org/support/plugin/ultimate-member\" rel=\"ugc\">support forum</a>.</p>\n\";s:12:\"installation\";s:268:\"<ol>\n<li>Activate the plugin</li>\n<li>That&#8217;s it. Go to Ultimate Member &gt; Settings to customize plugin options</li>\n<li>For more details, please visit the official <a href=\"http://docs.ultimatemember.com/\" rel=\"nofollow ugc\">Documentation</a> page.</li>\n</ol>\n\";s:3:\"faq\";s:3302:\"\n<dt id=\'do%20i%20need%20to%20know%20any%20coding%20to%20use%20this%20plugin%3F\'>\nDo I need to know any coding to use this plugin?\n</h4>\n<p>\n<p>No, we have built Ultimate Member to be extremely easy to use and does not require you to manually build shortcodes or have any coding knowledge.</p>\n</p>\n<dt id=\'is%20ultimate%20member%20mobile%20responsive%3F\'>\nIs Ultimate Member mobile responsive?\n</h4>\n<p>\n<p>Yes. Ultimate Member is designed to adapt nicely to any screen resolution. It includes specific designs for phones, tablets and desktops.</p>\n</p>\n<dt id=\'is%20ultimate%20member%20multi-site%20compatible%3F\'>\nIs Ultimate Member multi-site compatible?\n</h4>\n<p>\n<p>Yes. Ultimate Member works great on both single site and multi-site WordPress installs.</p>\n</p>\n<dt id=\'does%20the%20plugin%20work%20with%20any%20wordpress%20theme%3F\'>\nDoes the plugin work with any WordPress theme?\n</h4>\n<p>\n<p>Yes. Ultimate Member will work with any properly coded theme. However, some themes may cause conflicts with the plugin. If you find a styling issue with your theme please create a post in the community forum.</p>\n</p>\n<dt id=\'does%20the%20plugin%20work%20with%20caching%20plugins%3F\'>\nDoes the plugin work with caching plugins?\n</h4>\n<p>\n<p>The plugin works with popular caching plugins by automatically excluding Ultimate Member pages from being cached. This ensures other visitors to a page will not see the private information of another user. However, if you add features of Ultimate Member to other pages you have to exclude those pages from being cached through your cache plugin settings panel.</p>\n</p>\n<dt id=\'does%20ultimate%20member%20restrict%20access%20to%20wp-login.php%20when%20the%20plugin%20is%20active%3F\'>\nDoes Ultimate Member restrict access to wp-login.php when the plugin is active?\n</h4>\n<p>\n<p>The plugin does not restrict access to the wp-login.php page when active, so that our plugin does not interfere with the existing functionality of a website or other plugins that may utilise the default login page. If you wish to restrict access to the wp-login.php page you can use a plugin such as <a href=\"https://wordpress.org/plugins/wps-hide-login/\" rel=\"ugc\">WPS Hide Login</a> or another plugin that removes the ability to login via wp-login.php.</p>\n</p>\n<dt id=\'are%20ultimate%20member%20login%2Fregistration%20pages%20required%3F\'>\nAre Ultimate Member Login/Registration pages required?\n</h4>\n<p>\n<p>No, you do not need to use our plugin’s login or registration pages and can use another plugin or the default WordPress methods for user registration and login.</p>\n</p>\n<dt id=\'are%20additional%20php%20modules%20necessary%20for%20the%20plugin%20to%20work%20correctly%3F\'>\nAre additional PHP modules necessary for the plugin to work correctly?\n</h4>\n<p>\n<p>No specific extensions are needed. But we highly recommended keep active these PHP modules: <code>mbstring</code>, <code>json</code>, <code>dom</code>, <code>exif</code>, <code>gd</code>, <code>fileinfo</code>, <code>curl</code>, <code>iconv</code>. wp-admin &gt; Tools &gt; Site Health page has a summary about your installation and required modules. All major extensions are listed <a href=\"https://make.wordpress.org/hosting/handbook/server-environment/#php-extensions\" rel=\"nofollow ugc\">here</a>.</p>\n</p>\n\n\";s:9:\"changelog\";s:9473:\"<h4>Important:</h4>\n<p>IMPORTANT: PLEASE UPDATE THE PLUGIN TO AT LEAST VERSION 2.6.7 IMMEDIATELY. VERSION 2.6.7 PATCHES SECURITY PRIVILEGE ESCALATION VULNERABILITY. PLEASE SEE <a href=\"https://docs.ultimatemember.com/article/1866-security-incident-update-and-recommended-actions\" rel=\"nofollow ugc\">THIS ARTICLE</a> FOR MORE INFORMATION</p>\n<h4>2.10.5 2025-06-25</h4>\n<p><strong>Enhancements</strong></p>\n<ul>\n<li>Added: Filter hook <a href=\"https://ultimatemember.github.io/ultimatemember/hooks/um_password_reset_form_primary_btn_classes.html\" rel=\"nofollow ugc\"><code>um_password_reset_form_primary_btn_classes</code></a> for primary button classes in UM Password Reset form.</li>\n<li>Added: Filter hook <a href=\"https://ultimatemember.github.io/ultimatemember/hooks/um_login_form_primary_btn_classes.html\" rel=\"nofollow ugc\"><code>um_login_form_primary_btn_classes</code></a> for primary button classes in UM Login form.</li>\n<li>Added: Filter hook <a href=\"https://ultimatemember.github.io/ultimatemember/hooks/um_register_form_primary_btn_classes.html\" rel=\"nofollow ugc\"><code>um_register_form_primary_btn_classes</code></a> for primary button classes in UM Registration form.</li>\n<li>Tweak: Refactored Site Health data, added hooks for 3rd-party integration.</li>\n<li>Tweak: Avoid using <code>um_user( \'password_reset_link\' )</code> and make it directly with <code>UM()-&gt;password()-&gt;reset_url( $user_id )</code> for getting a proper reset URL.</li>\n<li>Tweak: Avoid using <code>um_user( \'account_activation_link\' )</code> and make it directly with <code>UM()-&gt;permalinks()-&gt;activate_url( $user_id )</code> for getting a proper activation URL.</li>\n</ul>\n<p><strong>Bugfixes</strong></p>\n<ul>\n<li>Fixed: Stripped shortcodes in the user data during the Account, Registration and Profile forms submission. (Thanks to <a href=\"https://github.com/MissVeronica\" rel=\"nofollow ugc\">MissVeronica</a>)</li>\n<li>Fixed: Email placeholders values.</li>\n<li>Fixed: Refactor deactivation logic to un-schedule Action Scheduler actions.</li>\n<li>Fixed: Action Scheduler library errors. Updated to the recent 3.9.2 version.</li>\n<li>Fixed: Secondary email field validation.</li>\n<li>Fixed: Action Scheduler batch actions with users who have Undefined status.</li>\n<li>Fixed: Restrictions for 3rd-party Gutenberg Blocks.</li>\n<li>Fixed: Date/time picker filter-types range query on Member Directories.</li>\n<li>Fixed: Renamed &#8220;Macedonia, the former Yugoslav Republic of&#8221; to the official &#8220;North Macedonia&#8221;.</li>\n</ul>\n<p><strong>Deprecated</strong></p>\n<ul>\n<li>Fully deprecated <code>account_activation_link_tags_patterns( $placeholders )</code> function. It&#8217;s not used previously. Used email function arguments instead.</li>\n<li>Fully deprecated <code>account_activation_link_tags_replaces( $replace_placeholders )</code> function. It&#8217;s not used previously. Used email function arguments instead.</li>\n<li>Fully deprecated <code>UM()-&gt;profile()-&gt;add_placeholder()</code> function. Used email function arguments instead.</li>\n<li>Fully deprecated <code>UM()-&gt;profile()-&gt;add_replace_placeholder()</code> function. Used email function arguments instead.</li>\n<li>Fully deprecated <code>UM()-&gt;user()-&gt;add_activation_placeholder()</code> function. Used email function arguments instead.</li>\n<li>Fully deprecated <code>UM()-&gt;user()-&gt;add_activation_replace_placeholder()</code> function. Used email function arguments instead.</li>\n<li>Deprecated <code>UM()-&gt;user()-&gt;maybe_generate_password_reset_key( $userdata )</code> function. Use <code>UM()-&gt;common()-&gt;users()-&gt;maybe_generate_password_reset_key( $userdata )</code> instead.</li>\n<li>Deprecated <code>UM()-&gt;user()-&gt;set_last_login()</code> function. Use <code>UM()-&gt;common()-&gt;users()-&gt;set_last_login( $user_id )</code> instead.</li>\n</ul>\n<p><strong>Templates required update</strong></p>\n<ul>\n<li>password-reset.php</li>\n</ul>\n<p><strong>Cached and optimized/minified assets(JS/CSS) must be flushed/re-generated after upgrade</strong></p>\n<h4>2.10.4 2025-05-15</h4>\n<p><strong>Bugfixes</strong></p>\n<ul>\n<li>Fixed: Security issue CVE ID: CVE-2025-47691. Used &#8220;sniccowp/php-scoper-wordpress-excludes&#8221; for getting the recent WordPress functions list and added them to the dynamic blacklist based on the WordPress version.</li>\n<li>Fixed: The Action Scheduler action <code>um_set_default_account_status</code>. Case when some users were approved manually or deleted, and we need to reset the admin notice. Added <code>error_log()</code> to the wrong conditions.</li>\n<li>Fixed: Reset Password request from not a predefined password reset page. It&#8217;s possible to submit reset password form sitewide using block or shortcode.</li>\n<li>Fixed: Setting &#8216;Allow users to change email&#8217; for the Account page. It works now for any role instead of only the roles with &#8216;Can edit other member accounts?&#8217; capability enabled.</li>\n</ul>\n<h4>2.10.3 2025-04-24</h4>\n<p><strong>Enhancements</strong></p>\n<ul>\n<li>Added: The <code>Ignore the \"User Role &gt; Registration Options\"</code> setting. It provides an ability to auto-approve users if they were created via wp-admin &gt; Users screen.</li>\n<li>Tweak: Avoid email notifications to Administrator about user registration via wp-admin &gt; Users screen.</li>\n<li>Tweak: Updated the Action Scheduler implementation to improve flexibility and clarity. Refactor Action Scheduler for not only email handling.</li>\n</ul>\n<p><strong>Bugfixes</strong></p>\n<ul>\n<li>Fixed: Member Directory styles when it&#8217;s rendered on the Gutenberg builder page.</li>\n<li>Fixed: Member Directory filtering query when the custom users metatable is used.</li>\n<li>Fixed: PHP Warning that occurs when using the <code>getimagesize</code> function with an image from an external source.</li>\n<li>Fixed: Reset Password email notification&#8217;s the {password_reset_link}` placeholder.</li>\n<li>Fixed: Changed &#8220;Turkey&#8221; to the current official term &#8220;Türkiye&#8221;.</li>\n</ul>\n<p><strong>Cached and optimized/minified assets(JS/CSS) must be flushed/re-generated after upgrade</strong></p>\n<h4>2.10.2 2025-04-02</h4>\n<p><strong>Enhancements</strong></p>\n<ul>\n<li>Added: <code>UM()-&gt;common()-filesystem()::maybe_init_wp_filesystem();</code> method.</li>\n<li>Added: <code>UM()-&gt;common()-filesystem()::remove_dir();</code> method.</li>\n</ul>\n<p><strong>Bugfixes</strong></p>\n<ul>\n<li>Fixed: Security issue CVE ID: CVE-2025-1702. Reviewed general search scripts and suggested another solution that uses only <code>$wpdb-&gt;prepare()</code>.</li>\n</ul>\n<h4>2.10.1 2025-03-03</h4>\n<p><strong>Bugfixes</strong></p>\n<ul>\n<li>Fixed: Security issue CVE ID: CVE-2025-1702.</li>\n<li>Fixed: Activation link redirects to Reset Password after registration without password field and required email activation.</li>\n<li>Fixed: Honeypot scripts/styles for themes without pre-rendered shortcodes. Enqueue honeypot scripts/styles everytime.</li>\n<li>Fixed: Profile photo metadata when Gravatar image is used.</li>\n</ul>\n<p><strong>Cached and optimized/minified assets(JS/CSS) must be flushed/re-generated after upgrade</strong></p>\n<h4>2.10.0 2025-02-18</h4>\n<p><strong>Enhancements</strong></p>\n<ul>\n<li>Added: User Profile <code>form-id</code> attribute and updated code for Profile/Cover photos actions dropdowns.</li>\n<li>Added: Honeypot scripts/styles via <code>wp_add_inline_script()</code>, <code>wp_add_inline_style()</code> changed from direct adding in header and footer.</li>\n<li>Updated: We&#8217;ve made improvements to requests for extension updates to boost stability.</li>\n<li>Updated: PHP requirement &#8211; the minimum PHP version is now upgraded to 7.0.</li>\n<li>Updated: Using $wpdb and WPCS for queries. Set minimum required version to 6.2 due to using %i for <code>$wpdb-&gt;prepare()</code>.</li>\n<li>Updated: Revised wp-admin user actions handling. Now, the required capability is <code>edit_users</code> instead of <code>manage_options</code>.</li>\n<li>Removed: User Profile hidden inputs on view mode.</li>\n<li>Tweak: WPCS enhancements.</li>\n</ul>\n<p><strong>Bugfixes</strong></p>\n<ul>\n<li>Fixed: Security issue CVE ID: CVE-2024-12276.</li>\n<li>Fixed: Custom usermeta table metakeys for filtering in member directory (from <code>_money_spent</code> to <code>wc_money_spent_</code> and added <code>wc_order_count_</code>).</li>\n<li>Fixed: Layout for &#8220;Download your data&#8221; and &#8220;Erase of your data&#8221; fields.</li>\n<li>Fixed: Image sizes used for Open Graph meta in User Profile headers are now corrected.</li>\n<li>Fixed: &#8220;Delete account text&#8221; settings visibility issue in wp-admin.</li>\n<li>Fixed: The &#8220;Privacy Policy&#8221; field in the registration form. Disallowed HTML from the &#8220;Privacy Policy&#8221; content (like <code>&lt;form&gt;</code>) is filtered out by the <code>wp_kses()</code> function.</li>\n<li>Fixed: Password fields are now sanitized the WordPress native way, with <code>wp_unslash()</code> omitted post-submission.</li>\n</ul>\n<p><strong>Templates required update</strong></p>\n<ul>\n<li>gdpr-register.php</li>\n<li>profile.php</li>\n</ul>\n<p><strong>Cached and optimized/minified assets(JS/CSS) must be flushed/re-generated after upgrade</strong></p>\n<p><a href=\"https://plugins.svn.wordpress.org/ultimate-member/trunk/changelog.txt\" rel=\"nofollow ugc\">See changelog for all versions</a>.</p>\n\";s:11:\"screenshots\";s:2541:\"<ol><li><a href=\"https://ps.w.org/ultimate-member/assets/screenshot-1.png?rev=3160947\"><img src=\"https://ps.w.org/ultimate-member/assets/screenshot-1.png?rev=3160947\" alt=\"Screenshot 1\"></a><p>Screenshot 1</p></li><li><a href=\"https://ps.w.org/ultimate-member/assets/screenshot-2.png?rev=3160947\"><img src=\"https://ps.w.org/ultimate-member/assets/screenshot-2.png?rev=3160947\" alt=\"Screenshot 2\"></a><p>Screenshot 2</p></li><li><a href=\"https://ps.w.org/ultimate-member/assets/screenshot-3.png?rev=3160947\"><img src=\"https://ps.w.org/ultimate-member/assets/screenshot-3.png?rev=3160947\" alt=\"Screenshot 3\"></a><p>Screenshot 3</p></li><li><a href=\"https://ps.w.org/ultimate-member/assets/screenshot-4.png?rev=3160947\"><img src=\"https://ps.w.org/ultimate-member/assets/screenshot-4.png?rev=3160947\" alt=\"Screenshot 4\"></a><p>Screenshot 4</p></li><li><a href=\"https://ps.w.org/ultimate-member/assets/screenshot-5.png?rev=3160947\"><img src=\"https://ps.w.org/ultimate-member/assets/screenshot-5.png?rev=3160947\" alt=\"Screenshot 5\"></a><p>Screenshot 5</p></li><li><a href=\"https://ps.w.org/ultimate-member/assets/screenshot-6.png?rev=3160947\"><img src=\"https://ps.w.org/ultimate-member/assets/screenshot-6.png?rev=3160947\" alt=\"Screenshot 6\"></a><p>Screenshot 6</p></li><li><a href=\"https://ps.w.org/ultimate-member/assets/screenshot-7.png?rev=3160947\"><img src=\"https://ps.w.org/ultimate-member/assets/screenshot-7.png?rev=3160947\" alt=\"Screenshot 7\"></a><p>Screenshot 7</p></li><li><a href=\"https://ps.w.org/ultimate-member/assets/screenshot-8.png?rev=3160947\"><img src=\"https://ps.w.org/ultimate-member/assets/screenshot-8.png?rev=3160947\" alt=\"Screenshot 8\"></a><p>Screenshot 8</p></li><li><a href=\"https://ps.w.org/ultimate-member/assets/screenshot-9.png?rev=3160947\"><img src=\"https://ps.w.org/ultimate-member/assets/screenshot-9.png?rev=3160947\" alt=\"Screenshot 9\"></a><p>Screenshot 9</p></li><li><a href=\"https://ps.w.org/ultimate-member/assets/screenshot-10.png?rev=3160947\"><img src=\"https://ps.w.org/ultimate-member/assets/screenshot-10.png?rev=3160947\" alt=\"Screenshot 10\"></a><p>Screenshot 10</p></li><li><a href=\"https://ps.w.org/ultimate-member/assets/screenshot-11.png?rev=3160947\"><img src=\"https://ps.w.org/ultimate-member/assets/screenshot-11.png?rev=3160947\" alt=\"Screenshot 11\"></a><p>Screenshot 11</p></li><li><a href=\"https://ps.w.org/ultimate-member/assets/screenshot-12.png?rev=3160947\"><img src=\"https://ps.w.org/ultimate-member/assets/screenshot-12.png?rev=3160947\" alt=\"Screenshot 12\"></a><p>Screenshot 12</p></li></ol>\";s:7:\"reviews\";s:17146:\"<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">Migrated huge member site, A+ experience</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"5 out of 5 stars\" data-title-template=\"%s out of 5 stars\" data-rating=\"5\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				By <a href=\"https://profiles.wordpress.org/maxellinger/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/d602f4a0222da1c0c4b794be74c9684d8a98dca12dc45911ca7ddbd21ee9d909?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/d602f4a0222da1c0c4b794be74c9684d8a98dca12dc45911ca7ddbd21ee9d909?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/maxellinger/\" class=\"reviewer-name\">maxellinger</a> on <span class=\"review-date\">July 31, 2025</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\"><!-- wp:paragraph -->\n<p>I never leave reviews for plugins, but having just spent several months with Ultimate Member I feel compelled to. I was responsible for migrating a 1,000+ member organization site from an old BuddyPress setup to UM and the transition was lovely. The Stripe integration is particularly well-implemented. Some of the frontend styles and markup are a little outdated, and I would appreciate some easier styling through CSS vars, but my complaints are minimal. All the extensions and sister plugins do what they say on the tin (though the Jobs one needs maybe a little English pass). </p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">User profile integration is fantastic</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"5 out of 5 stars\" data-title-template=\"%s out of 5 stars\" data-rating=\"5\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				By <a href=\"https://profiles.wordpress.org/dterry/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/5cf9bb9fb3f5f8170e69cc8cc7b3719e756f86afca23b3fcf47c7e65d7a6aa5e?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/5cf9bb9fb3f5f8170e69cc8cc7b3719e756f86afca23b3fcf47c7e65d7a6aa5e?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/dterry/\" class=\"reviewer-name\">dterry</a> on <span class=\"review-date\">June 20, 2025</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\"><!-- wp:paragraph -->\n<p>I\'m using this plugin to enhance user profile photo display and it works like a charm. Love how clean and responsive the widget is. It even respects user permissions properly exactly what I needed for a members-only area on my site. Bonus points for not breaking my layout even with heavy CSS customization.</p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">Nice plugin</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"5 out of 5 stars\" data-title-template=\"%s out of 5 stars\" data-rating=\"5\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				By <a href=\"https://profiles.wordpress.org/austria88/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/28f77f71bd721d6a2b9afb66ee88b1b067a1f79480ebaa3783837f81c9635439?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/28f77f71bd721d6a2b9afb66ee88b1b067a1f79480ebaa3783837f81c9635439?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/austria88/\" class=\"reviewer-name\">Phil <small>(austria88)</small></a> on <span class=\"review-date\">April 15, 2025</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\"><!-- wp:paragraph -->\n<p>Super plugin and easy to use.</p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">Great support</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"5 out of 5 stars\" data-title-template=\"%s out of 5 stars\" data-rating=\"5\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				By <a href=\"https://profiles.wordpress.org/simplybrf/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/1c037a55ce10dae4da62d1304e15085455f51aa03a513c3ad75a1428871e10e8?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/1c037a55ce10dae4da62d1304e15085455f51aa03a513c3ad75a1428871e10e8?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/simplybrf/\" class=\"reviewer-name\">Simply <small>(simplybrf)</small></a> on <span class=\"review-date\">April 8, 2025</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\"><!-- wp:paragraph -->\n<p>I hade some issue adding an extension on my multisite installation. Also need some help with multisite blocking approval of new user.<br /><br />Andrew gave me quick and professional support. Also got som php code to bypass wordpress blocking approval on subsite.</p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">Ok but what for?</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"2 out of 5 stars\" data-title-template=\"%s out of 5 stars\" data-rating=\"2\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-empty\"></span><span class=\"star dashicons dashicons-star-empty\"></span><span class=\"star dashicons dashicons-star-empty\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				By <a href=\"https://profiles.wordpress.org/patrickhaond/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/9e8473b7f3ba16de21ad144fe3ecaa0ba1cdc8abd85d665a5574325704246daf?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/9e8473b7f3ba16de21ad144fe3ecaa0ba1cdc8abd85d665a5574325704246daf?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/patrickhaond/\" class=\"reviewer-name\">Pat <small>(patrickhaond)</small></a> on <span class=\"review-date\">March 31, 2025</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\"><!-- wp:paragraph -->\n<p>I can\'t see what improvement compare to what already exists in WordPress core, except a few options.<br />Moreover a bit complex to customize.</p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">Getting attacks from bot</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"1 out of 5 stars\" data-title-template=\"%s out of 5 stars\" data-rating=\"1\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-empty\"></span><span class=\"star dashicons dashicons-star-empty\"></span><span class=\"star dashicons dashicons-star-empty\"></span><span class=\"star dashicons dashicons-star-empty\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				By <a href=\"https://profiles.wordpress.org/idighs/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/428fe8b1dece8f440dd80f82481a2c783982705455d43576e2f32b73e9da5ef5?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/428fe8b1dece8f440dd80f82481a2c783982705455d43576e2f32b73e9da5ef5?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/idighs/\" class=\"reviewer-name\">Idighekere <small>(idighs)</small></a> on <span class=\"review-date\">March 27, 2025</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\"><!-- wp:paragraph -->\n<p>i get lots of random users on my site. New users with weird names are created regularly, deactivating the plugin stops this behavior. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>i got close to 1700 new members in a space of 2 months. They all had names with random characters. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">Wouldn&#039;t accept email address</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"3 out of 5 stars\" data-title-template=\"%s out of 5 stars\" data-rating=\"3\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-empty\"></span><span class=\"star dashicons dashicons-star-empty\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				By <a href=\"https://profiles.wordpress.org/lancinginternet/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/2acc81a9202a6729a95dd18a2caa226ac6dac66d7ad399c4efcabe03da0a772a?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/2acc81a9202a6729a95dd18a2caa226ac6dac66d7ad399c4efcabe03da0a772a?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/lancinginternet/\" class=\"reviewer-name\">lancinginternet</a> on <span class=\"review-date\">March 10, 2025</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\"><!-- wp:paragraph -->\n<p>Thought this looked good, but fell at the first hurdle. Did a test user registration, but it told me my email address (.net) was invalid!</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>UPDATE:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>I have discovered that this is an erroneous error message. What it should actually say is that the email address I was trying to register was already registered.</p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">Ultimate Is Great for My Blogg</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"5 out of 5 stars\" data-title-template=\"%s out of 5 stars\" data-rating=\"5\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				By <a href=\"https://profiles.wordpress.org/elliottpaige/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/c8167cef50d768d24aee85bb795f9d33d0ab5eb7c0389a1a5e553883511f0863?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/c8167cef50d768d24aee85bb795f9d33d0ab5eb7c0389a1a5e553883511f0863?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/elliottpaige/\" class=\"reviewer-name\">Elliott <small>(elliottpaige)</small></a> on <span class=\"review-date\">March 7, 2025</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\"><!-- wp:paragraph -->\n<p>I use Ultimate to manage my blog membership. The plugin has been great in helping me grow my membership. I am trying now to block bots signup. I think it will do the trick, by blocking commonly used usernames of the bots. Let\'s see. But so far so good!</p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">Hardcode crap</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"2 out of 5 stars\" data-title-template=\"%s out of 5 stars\" data-rating=\"2\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-empty\"></span><span class=\"star dashicons dashicons-star-empty\"></span><span class=\"star dashicons dashicons-star-empty\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				By <a href=\"https://profiles.wordpress.org/elnine/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/9ee90eb19231b9e6e4323f4903b39e478113e0063f3a7df4e8a331f259a3d0c2?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/9ee90eb19231b9e6e4323f4903b39e478113e0063f3a7df4e8a331f259a3d0c2?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/elnine/\" class=\"reviewer-name\">elnine</a> on <span class=\"review-date\">February 28, 2025</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\"><!-- wp:paragraph -->\n<p>So, unfortunately its a crap. Yes, it do what u need. But, there is a lot of hardcode, a lot of hard css and js, who ruined speed of every!! page on your site. Slowdown pages about 60%. 2 days to override this and.... ah... delete it. </p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class=\"review\">\n	<div class=\"review-head\">\n		<div class=\"reviewer-info\">\n			<div class=\"review-title-section\">\n				<h4 class=\"review-title\">Difficult to manage and maintain</h4>\n				<div class=\"star-rating\">\n				<div class=\"wporg-ratings\" aria-label=\"2 out of 5 stars\" data-title-template=\"%s out of 5 stars\" data-rating=\"2\" style=\"color:#ffb900;\"><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-filled\"></span><span class=\"star dashicons dashicons-star-empty\"></span><span class=\"star dashicons dashicons-star-empty\"></span><span class=\"star dashicons dashicons-star-empty\"></span></div>				</div>\n			</div>\n			<p class=\"reviewer\">\n				By <a href=\"https://profiles.wordpress.org/clinicien/\"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/81ac1c7d81d6161491ab166611b664870d5e596e5fa27fbe57694df8ca73b83c?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/81ac1c7d81d6161491ab166611b664870d5e596e5fa27fbe57694df8ca73b83c?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href=\"https://profiles.wordpress.org/clinicien/\" class=\"reviewer-name\">clinicien</a> on <span class=\"review-date\">February 10, 2025</span>			</p>\n		</div>\n	</div>\n	<div class=\"review-body\"><!-- wp:paragraph -->\n<p>I\'ve used this plugin for more than 2 years on 2 websites and I\'ve bought the Pro version. <br />I regret it.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The plugin do the job. Yes… BUT the UI/UX is reallybad and you will have to manage awfull CSS stylesheet with dozen of class, IDs and \"!important\" CSS rules if you would change any layout on forms or user profile unless you buy their own theme… which is very dubious for a standalone plugin.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Another plugin that relies on its past reputation without offering any significant improvements. It\'s a shame.</p>\n<!-- /wp:paragraph --></div>\n</div>\n\";}s:17:\"short_description\";s:146:\"Membership &amp; community plugin with user profiles, registration &amp; login, member directories, content restriction, user roles and much more.\";s:13:\"download_link\";s:65:\"https://downloads.wordpress.org/plugin/ultimate-member.2.10.5.zip\";s:14:\"upgrade_notice\";a:13:{s:6:\"2.10.4\";s:70:\"<p>This version fixes a security related bug. Upgrade immediately.</p>\";s:6:\"2.10.2\";s:70:\"<p>This version fixes a security related bug. Upgrade immediately.</p>\";s:6:\"2.10.1\";s:70:\"<p>This version fixes a security related bug. Upgrade immediately.</p>\";s:6:\"2.10.0\";s:184:\"<p>Increased the minimum PHP and WordPress requirements. The plugin now requires at least PHP 7.0 and WordPress 6.2. This version fixes a security related bug. Upgrade immediately.</p>\";s:5:\"2.9.2\";s:70:\"<p>This version fixes a security related bug. Upgrade immediately.</p>\";s:5:\"2.9.0\";s:70:\"<p>This version fixes a security related bug. Upgrade immediately.</p>\";s:5:\"2.8.7\";s:70:\"<p>This version fixes a security related bug. Upgrade immediately.</p>\";s:5:\"2.8.5\";s:70:\"<p>This version fixes a security related bug. Upgrade immediately.</p>\";s:5:\"2.8.4\";s:70:\"<p>This version fixes a security related bug. Upgrade immediately.</p>\";s:5:\"2.8.3\";s:70:\"<p>This version fixes a security related bug. Upgrade immediately.</p>\";s:5:\"2.6.7\";s:270:\"<p>This version fixes a privilege escalation vulnerability used through UM Forms. Known in the wild that vulnerability allowed strangers to create administrator-level WordPress users. Please update immediately and check all administrator-leve